class Solution {
  List<int> findMissingAndRepeatedValues(List<List<int>> grid) {
    int n = grid.length;
    int size = n * n;
    List<int> frequency = List.filled(size + 1, 0);
    int repeated = 0;
    int missing = 0;

    // Count the frequency of each number
    for (var row in grid) {
      for (var num in row) {
        frequency[num]++;
      }
    }

    // Find the repeated and missing numbers
    for (int i = 1; i <= size; i++) {
      if (frequency[i] == 2) {
        repeated = i;
      } else if (frequency[i] == 0) {
        missing = i;
      }
    }

    return [repeated, missing];
  }
}
